-- ----------------------------
-- Records of sp_worker
-- ----------------------------

-- ----------------------------
-- View structure for `sp_vcks`
-- ----------------------------
DROP VIEW IF EXISTS `sp_vcks`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `sp_vcks` AS (select `a`.`id` AS `id`,`a`.`dwqc` AS `dwqc`,`b`.`je` AS `je`,`b`.`gzny` AS `gzny` from (`sp_org` `a` join `vcks_1` `b` on((`a`.`id` = `b`.`orgid`))) where ((`b`.`gzny` like '2015%') and (`a`.`id` = ''))) ;

-- ----------------------------
-- View structure for `vcks_1`
-- ----------------------------
DROP VIEW IF EXISTS `vcks_1`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vcks_1` AS (select sum(`sp_pay`.`je`) AS `je`,`sp_pay`.`orgid` AS `orgid`,`sp_pay`.`gzny` AS `gzny` from `sp_pay` group by `sp_pay`.`orgid`,`sp_pay`.`gzny`) ;
